class Solution:
    def jump(self, nums: List[int]) -> int:

        l = r = currJumps= 0
        while r < len(nums)-1:
            for i in range(l, r+1):
                if nums[i] + i > r:
                    r = nums[i] + i
                    l = i
            currJumps += 1
        return currJumps




